"use strict";

function f_gold(releaseTimes, keysPressed) {
    let ans = keysPressed[0];
    let mx = releaseTimes[0];
    for (let i = 1; i < keysPressed.length; i++) {
        let d = releaseTimes[i] - releaseTimes[i - 1];
        if (d > mx || (d === mx && keysPressed.charCodeAt(i) > ans.charCodeAt(0))) {
            mx = d;
            ans = keysPressed[i];
        }
    }
    return ans;
}
